    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %} Page d'authentification! {% endblock %}

{% block body %}

<br/><br/>
{% block content %}
<form method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"mb-3\">
            Vous êtes connecté en tant que {{ app.user.username }}, <a href=\"{{ path('app_logout') }}\"> Se déconnecter </a>
        </div>
    {% endif %}

    <div class=\"container bg-white\">
        <h1 class=\"h3 mb-3 font-weight-normal\"> Veuillez vous identifier </h1>
        <label for=\"inputlogin\"> votre login </label>
        <input type=\"text\" value=\"{{ last_username }}\" name=\"login\" id=\"inputlogin\" class=\"form-control\" autocomplete=\"login\" required autofocus>
        <label for=\"inputPassword\"> Votre mot de passe </label>
        <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>

        <input type=\"hidden\" name=\"_csrf_token\"
               value=\"{{ csrf_token('authenticate') }}\"
        >

        <button class=\"btn btn-lg btn-primary mt-2\" type=\"submit\">
            Se connecter
        </button>
    </div>

    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}


</form>
{% endblock %}

<br/><br/>

{% block footer %}
{% endblock %}
{% endblock %}
", "security/login.html.twig", "C:\\wamp64\\www\\Retrouvailles_NABI.com\\templates\\security\\login.html.twig");
